const Table = ({ className, children, ...props }) => (
    <table className={`w-full text-sm text-left ${className}`} {...props}>
      {children}
    </table>
  );
  
  const TableHeader = ({ className, children, ...props }) => (
    <thead className={`text-xs text-gray-700 uppercase bg-gray-50 ${className}`} {...props}>
      {children}
    </thead>
  );
  
  const TableBody = ({ className, children, ...props }) => (
    <tbody className={className} {...props}>
      {children}
    </tbody>
  );
  
  const TableHead = ({ className, children, ...props }) => (
    <th className={`px-6 py-3 ${className}`} {...props}>
      {children}
    </th>
  );
  
  const TableRow = ({ className, children, ...props }) => (
    <tr className={`bg-white border-b hover:bg-gray-50 ${className}`} {...props}>
      {children}
    </tr>
  );
  
  const TableCell = ({ className, children, ...props }) => (
    <td className={`px-6 py-4 ${className}`} {...props}>
      {children}
    </td>
  );
  
  export { Table, TableHeader, TableBody, TableHead, TableRow, TableCell };
